import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import logo from '../logo.svg'
export const Navigation = () => {
  return (
    <BrowserRouter>
    <div className="">
        <>
            <img src={logo} alt="React Logo"/>
        </>
    </div>
    </BrowserRouter>
  )
}
